import React, { Component } from "react";
import Axios from "axios";
import "./law_report.css";

class law_report extends Component {
  constructor(props) {
    super(props);
    this.state = {
      lawyersReporter: [],
    };
  }
  componentDidMount = (props) => {
    Axios.get("/lawyersReporter").then((response) => {
      //console.log(response.data.tem_c);
      console.log(response);
      this.setState({
        lawyersReporter: response.data,
      });
    });
  };

  render() {
    const columns = [
      {
        Header: "Employee ID",
        accessor: "employee_ID",
      },
      {
        Header: "First Name",
        accessor: "firstName",
      },
      {
        Header: "Last Name",
        accessor: "lastName",
      },
      {
        Header: "Grading",
        accessor: "barGrading",
      },
    ];

    //return <div>hello</div>;
    return <ReactTable columns={columns}></ReactTable>;
  }
}

export default law_report;
